import React, { Fragment } from 'react'
import { CgMouse } from "icons";
import "./Home.css";

const Home = () => {
  return (
  <Fragment>
    <div className="banner">
        <p> Seja Bem Vindo | Ecommerce Fetech</p>
        <h1>Teste H1</h1>
        <a href="#container">
            <button>
                Scroll <CgMouse />
            </button>
        </a>
    </div>
  </Fragment>
  );
};
export default Home;
